import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import {
    Box,
    Typography,
    Card,
    CardContent,
    CardActions,
    Button,
    Grid,
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        background: {
            default: '#282c34',
        },
    },
    components: {
        MuiOutlinedInput: {
            styleOverrides: {
                root: {
                    '& .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    '&:hover .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    '&.Mui-focused .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    color: 'white',
                },
                input: {
                    color: 'white',
                },
                notchedOutline: {
                    borderColor: 'white',
                },
            },
        },
        MuiInputLabel: {
            styleOverrides: {
                root: {
                    color: 'white',
                },
            },
        },
    },
});

const getCollectionList = async (userId) => {
    const BASE_URL = 'https://peoplemuseumyeah.uc.r.appspot.com/db';

    try {
        const response = await axios.post(`${BASE_URL}/getCollectionList`, {
            userId,
        }, {
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Status:', response.status);
        console.log('Data:', response.data);
        return response.data.collections; // Return the collections array from the response
    } catch (error) {
        console.error('Error:', error.message);
        throw error;
    }
};

const deleteCollection = async (collectionId) => {
    const BASE_URL = 'https://peoplemuseumyeah.uc.r.appspot.com/db';

    try {
        const response = await axios.delete(`${BASE_URL}/deleteCollection`, {
            data: { collectionId },
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Status:', response.status);
        console.log('Data:', response.data);
        return response.data; // Return response data after deleting collection
    } catch (error) {
        console.error('Error:', error.message);
        throw error;
    }
};

const CollectionList = () => {
    const userId = '1'; // Hardcoded userId as a string for demonstration
    const [collections, setCollections] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchCollections = async () => {
            try {
                const collectionsData = await getCollectionList(userId);
                setCollections(collectionsData);
            } catch (error) {
                console.error('Error fetching collections:', error);
                setError(error.message);
            } finally {
                setLoading(false);
            }
        };

        fetchCollections();
    }, [userId]); // useEffect dependency on userId to re-fetch collections if userId changes

    const handleDelete = async (collectionId) => {
        try {
            await deleteCollection(collectionId);
            setCollections(collections.filter((collection) => collection.collectionId !== collectionId));
        } catch (error) {
            console.error('Error deleting collection:', error);
        }
    };

    if (loading) {
        return (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                Loading...
            </Box>
        );
    }

    if (error) {
        return (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                Error: {error}
            </Box>
        );
    }

    return (
        <ThemeProvider theme={theme}>
            <Box
                sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    minHeight: '100vh',
                    p: 2,
                }}
            >
                <Typography variant="h4" gutterBottom color="primary" sx={{ textAlign: 'center' }}>
                    Collection List
                </Typography>
                <Button
                    component={Link}
                    to="/add-collection"
                    variant="contained"
                    color="primary"
                    sx={{ marginBottom: 2 }}
                >
                    Add Collection
                </Button>
                <Grid container spacing={2} justifyContent="center">
                    {collections.length > 0 ? (
                        collections.map((collection) => (
                            <Grid item key={collection.collectionId}>
                                <Card sx={{ maxWidth: 300, marginBottom: 2 }}>
                                    <CardContent>
                                        <Typography variant="h6" gutterBottom color="white">
                                            {collection.collectionName}
                                        </Typography>
                                        <Typography variant="body2" color="white">
                                            Description: {collection.description}
                                        </Typography>
                                    </CardContent>
                                    <CardActions>
                                        <Button
                                            component={Link}
                                            to={`/update-collection/${collection.collectionId}`}
                                            variant="outlined"
                                            color="primary"
                                            sx={{ marginRight: 1 }}
                                        >
                                            Update
                                        </Button>
                                        <Button
                                            variant="outlined"
                                            color="secondary"
                                            onClick={() => handleDelete(collection.collectionId)}
                                        >
                                            Delete
                                        </Button>
                                    </CardActions>
                                </Card>
                            </Grid>
                        ))
                    ) : (
                        <Typography variant="h6" color="text.secondary" sx={{ textAlign: 'center' }}>
                            No collections found
                        </Typography>
                    )}
                </Grid>
            </Box>
        </ThemeProvider>
    );
};

export default CollectionList;
